function addToNoticelistAjax(articleid,am=1){articleid="/index.php?cl=details&aid="+articleid+"&anid="+articleid+"&fnc=tonoticelist&am="+am+"&stoken="+document.querySelector("input[name=stoken]").value,am=new XMLHttpRequest;am.open("GET",articleid,!0),am.onerror=function(){console.log("error")},am.send()}